        }
    }
    render (){
        console.log(props)
        return (
            <Modal show={props.show} onHide={props.handleClose}>
               <Modal.Header closeButton>
                   <Modal.Title>Add New Photo</Modal.Title>
               </Modal.Header>
               <Modal.Body>
                   <div className='body-container'>
                       <input type='text' placeholder='Enter photo title...' />
                       <input type='text' placeholder='Enter the thumbnail url here...' />
                       <input type='text' placeholder='Enter the photo url here...' />
                       <Button variant="outline-dark">
                               Submit
                       </Button>
                   </div>
               </Modal.Body>
               <Modal.Footer>
                   <Button variant="outline-dark" >
                           Close
                   </Button>
               </Modal.Footer>
            </Modal>
        )
    } 
}
const mapDispatchToProps = (dispatch) => {
    return {
        handleClose: () => {
            dispatch(closeAddNewPhotoAction())
        }
    }
}
export default connect(null, mapDispatchToProps)(AddNewPhoto)
